import React, {Component} from 'react'
import phoneInput from "react-phone-number-input";

class MyApp extends Component {
    render(){

        return(
            <div className="MyApp">
                <LoginComponent/>
            </div>
        )
    }
}

class LoginComponent extends Component{

    render(){
        return (
            
            <div>

                <phoneInput
                    placeholder="Enter phone number"
                    value={value}
                    onChange={setValue}
                />

                {value}

            </div>
        )
        
    }

}

export default MyApp
